const DUMMY_EVENTS = [
  {
    id: "e",
    title: "Some event",
  },
  {
    id: "e",
    title: "Another Event",
  },
];

function EventsPage() {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {
            DUMMY_EVENTS.map(event => <li key={event.id}></li>)<Link
        }
      </ul>
    </>
  );
}
export default EventsPage;
